import React from 'react'
import './AllScenarios.css'

const AllScenarios = () => {
  return (
    <div className='container'><div className='btn'><button className='btnadd'>Add</button><button className='btnreset'>Reset</button><button className='btngoback'>Go Back</button></div></div>
  )
}

export default AllScenarios
